function get_malware($yara_dir)
{   
    $global:hash = @()
    $global:status = "Getting Malware from Volatility Indicators"
    $yara_files = (ls $yara_dir\yara*.xlsx | % {$_.Name})
    foreach($file in $yara_files){$yara_master += Import-Xls "$yara_dir\$file"}
    $yara_parser = $yara_master | %{ $_.Owner }
    $global:yara_process = $null; $global:yara_process = @{}
    foreach ($yara in $yara_parser)
    {
       $global:yara_process.Add((($yara | % {$_ -split":"})[1] | % {$_ -replace("\(","") -replace("\)","") -replace("Pid ","") -replace(" ","")}),(($yara | % {$_ -split":"})[0]))
    }
    D:
    cd 'D:\Week 5\volatility_standalone'
    foreach ($processID in $global:yara_process.Keys)
    {
        $tempName = $global:yara_process.$processID
        $tempName = $tempName | % {$_ -replace(".exe",".$processID.bad")}
        .\volatility.exe -f $global:memPath --profile=$global:profile --kdbg=$global:kdbg procdump -p $processID --dump-dir $global:outpath\Malware
        move $global:outpath\Malware\executable.$processID.exe $global:outpath\Malware\$tempName
        $hash = Get-FileHash $global:outpath\Malware\$tempName -Algorithm MD5
        $global:hash += $hash.Hash
        $hash_text = "$hash.Hash   ---    MD5 Hash of PID $processID"
        $hash_text | Out-File $global:outpath\Malware\hashes_of_malware.txt -Append
    }
    write-host "malicious exe found: <Not in Order> $global:process_name with PIDs $global:yara_pid <Not in Order>"
}

function get_VirusTotal 
{
    $VTApiKey = Get-Content $global:outpath\api.txt
    foreach($hash in $global:hash)
    {
        Start-Sleep -Seconds 15
        $body = @{ resource = $hash; apikey = $VTApiKey }
        $VTReport = Invoke-RestMethod -Method 'POST' -Uri 'https://www.virustotal.com/vtapi/v3/file/report' -Body $body
        $AVScanFound = @()

        if ($VTReport.positives -gt 0) {
            foreach($scan in ($VTReport.scans | Get-Member -type NoteProperty)) {
                if($scan.Definition -match "detected=(?<detected>.*?); version=(?<version>.*?); result=(?<result>.*?); update=(?<update>.*?})") {
                    if($Matches.detected -eq "True") {
                        $AVScanFound += "{0}({1}) - {2}" -f $scan.Name, $Matches.version, $Matches.result
                    }
                }
            }
        }

        $VTReportHTML = Invoke-WebRequest -Method Get -Uri $VTReport.permalink -OutFile $global:outpath\$hash.html
        #$VTReportHTML | Out-File $global:outpath\$hash.html
        New-Object –TypeName PSObject -Property ([ordered]@{
            MD5       = $VTReport.MD5
            SHA1      = $VTReport.SHA1
            SHA256    = $VTReport.SHA256
            VTLink    = $VTReport.permalink
            VTReport  = "$($VTReport.positives)/$($VTReport.total)"
            VTMessage = $VTReport.verbose_msg
            Engines   = $AVScanFound
        })
    }
}

function pcap_filter($pcap_path, $indications)
{
    $global:status = "Filtering PCAPs"
    D:
    cd $global:outpath
    foreach($indication in $indications)
    {
        $global:status = "Filtering PCAP for $indication"
        $path = "$global:outpath\Wireshark\PCAPs\$indication filter.pcap"
        .\WinDump.exe -n -r $pcap_path -w $path host $indication 
    }
}

