function get_status
{
    while(!$global:end)
    {
        Write-Progress -Activity "Parsing Files" -Status $global:status
    }
}

$export_functions = 
{
    function vol_info {$Function:vol_info }
}


function main()
{
    $global:start = Get-Date
    #get_status
    stage
    
    $csvfile = read_csv($global:netflowPath)
    $ips = $global:ip_frombox#('174.129.50.106')#get_ip
    $master= csv_parser $csvfile $ips
    $potential_ioc_ips = get_indicators $master[4]
    snort $global:pcapPath #snort is the fastest #### can be seperate job
    excel_export $master #build netflow Excel File #### can be seperate job
    $jobs = Start-Job -InitializationScript $export_functions -ArgumentList $global:memPath -ScriptBlock {vol_info}
    Wait-Job -Job $jobs
    $variables = Receive-Job -Job $jobs; $global:imageinfo=$variables[0]; $global:profile=$variables[1]; $global:kdbg=$variables[2]
    vol_info $global:memPath #get volatility profile and kdbg #### can be seperate job
    build_yara $potential_ioc_ips #### can be seperate job
    vol_scan #### can be seperate job
    get_malware $global:outpath\Volatility
    $better_IOCs = get_better_IOCs $global:outpath\Volatility\
    pcap_filter $global:pcapPath $better_IOCs
    $better_IOCs | Out-File $global:outpath\filtered_IP_List.txt
    $vtReport = get_VirusTotal
    $vtReport | Out-File $global:outpath\virus_total_report.txt
    cd $global:startDir
    $global:end = Get-Date

    Write-Host "this took $global:start to $global:end to run"
 
}

